import Icons from "../../assets/Icons";
const Note = () => {
  return (
    <div>
      <div className="card-note">
        <div className="check"></div>
        <div className="dp-f">
         div.header
          <Icons focusable="false" name="Pinned" size="20" />
        </div>
        <h1 className="fs-14">Hii</h1>
      </div>
    </div>
  );
};

export default Note;
